      <h5 className="temperature-country">24 C</h5>
      <h5 className="main-country">Clear</h5>
      <h6 className="temperature-min-country">11 C</h6>
      <h6 className="temperature-max-country">30 C</h6>
    </div>
  );
}

export default Card;
